package no.uka.findmyapp.ukaprogram.model;

// TODO: Auto-generated Javadoc
/**
 * The Class CustomParameter.
 */
public class CustomParameter
{
	
	/** The parameter name. */
	private String parameterName; 
	
	/** The parameter text value. */
	private String parameterTextValue; 
	
	/** The parameter number value. */
	private float parameterNumberValue; 
	
	/** The username. */
	private String username;
	
	/**
	 * Gets the parameter name.
	 *
	 * @return the parameter name
	 */
	public String getParameterName( ) {
		return parameterName;
	}
	
	/**
	 * Sets the parameter name.
	 *
	 * @param parameterName the new parameter name
	 */
	public void setParameterName(String parameterName ) {
		this.parameterName = parameterName;
	}
	
	/**
	 * Gets the parameter text value.
	 *
	 * @return the parameter text value
	 */
	public String getParameterTextValue( ) {
		return parameterTextValue;
	}
	
	/**
	 * Sets the parameter text value.
	 *
	 * @param parameterTextValue the new parameter text value
	 */
	public void setParameterTextValue(String parameterTextValue ) {
		this.parameterTextValue = parameterTextValue;
	}
	
	/**
	 * Gets the parameter number value.
	 *
	 * @return the parameter number value
	 */
	public float getParameterNumberValue( ) {
		return parameterNumberValue;
	}
	
	/**
	 * Sets the parameter number value.
	 *
	 * @param parameterNumberValue the new parameter number value
	 */
	public void setParameterNumberValue(float parameterNumberValue ) {
		this.parameterNumberValue = parameterNumberValue;
	}
	
	/**
	 * Gets the username.
	 *
	 * @return the username
	 */
	public String getUsername( ) {
		return username;
	}
	
	/**
	 * Sets the username.
	 *
	 * @param username the new username
	 */
	public void setUsername(String username ) {
		this.username = username;
	} 
	
	
}
